import './App.css';
import React from "react";
import Navbar from './components/Navbar';
import TableT from './components/tablet';

function App2() {
  return (
    <>
    <nav > 
      <h1>Lista de Tareas</h1>
      </nav>
    <Navbar />
    <div className='derecha'> 
      <TableT />
    </div>
    </>
  );
}
export default App2;
